import db from '@/utils/localstorage';
export default {
  name: 'ModelEdit',
  props: {
    type: {
      type: String,
      default: 'add'
    }
  },
  data: function data() {
    return {
      editVisible: false,
      url: process.env.VUE_APP_DEV_REQUEST_DOMAIN_PREFIX,
      modelId: null
    };
  },
  computed: {},
  watch: {},
  mounted: function mounted() {},
  methods: {
    open: function open(id) {
      this.editVisible = true;
      setTimeout(function () {
        var view = document.getElementById('editView');
        // var urlPrefix = process.env.VUE_APP_DEV_REQUEST_DOMAIN_PREFIX
        var url = "/api/activiti/static/index?modelId=".concat(id, "&tenant=").concat(db.get('TENANT', ''), "&token=Bearer ").concat(db.get('TOKEN', ''));
        view.innerHTML = "<iframe width=100% id=\"frameNode\" height=100% scrolling='no' frameborder=0 src=\"".concat(url, "\"></iframe>");
      }, 1000);
    },
    editClose: function editClose() {
      this.$parent.editClose();
    }
  }
};
